import React, { Component } from "react";
import { UserContainer } from "../containers/UserContainer";
import { PageContainer } from "../containers/UserContainer";

import "./App.css";

export class App extends Component {
  render() {
    const { page, user, getPhotosActions, handleLoginAction } = this.props;
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">My top photos from VK</h1>
        </header>

        <main>
          <PageContainer />
          <UserContainer />
        </main>
      </div>
    );
  }
}
